// แสดงรายการใบรับยาง
<template>
    <div class="container-fluid align-content-start ms-0">
        <div class="card card-primary mx-auto" style="width:auto">
            <div class="card-header bg-primary" style="color:white ;">
                รายการใบรับยาง
            </div>
        </div>
    </div>
</template>

<script>
import axios from "@/axios"

export default {
    data() {
        return {
            get_import_header: [],
            import_header: {
                import_book_id: "",
                import_book_no: "",
                cust_auto_id: "",
                import_user: "",
                import_type: "",
                import_date: "",
                import_status: "",
            },
        }
    },
    mounted: {

    },
    methods: {
        getImportHeader() {
            axios.get().then((response) => {
                this.get_import_header = response.data;
            });
        },
    },
}
</script>
